import React from "react";
import NavBarItem from "./NavBarItem";
import styles from "./NavBar.module.css";

const NavBar = (props) => {
  return (
    <div className={styles.container}>
      <div className={`${styles.content} ${styles.col_2}`} />
      <div className={`${styles.content} ${styles.col - 8}`}>
        <button className={styles.topButton}>Login</button>
        <button className={styles.topButton}>Register</button>
        <h1>Booking Website</h1>
        <ul>
          <NavBarItem />
        </ul>
      </div>
    </div>
  );
};

export default NavBar;
